(258, 246, 'freeze_tutorial', 'How To Play Freeze!', 1, 42, '1', '1', 1, '0', 4, 'pets2', 'catalog_freeze_en', 'Catalog_teaser_freeze', '', 'Find out how you can make and host your own Freeze! game by reading the instructions below!', 'How to play Freeze!', '1. Place Tiles and Blocks in your room. Always place blocks on top of tiles!\r\n\r\n2. Add Team Gates, a Counter, an Exit Tile and Scoreboards.\r\n\r\n3. Ready? Let your friends choose a team. Each team can have up to five players. Then click the Counter to start!\r\n\r\n4. To place a Snowball, double click on the tile that you are standing on, or double click on a tile next to you. Blow up Blocks for power-ups!\r\n\r\n5. Last team standing wins!', 'Remember: You will be warped to an Exit Tile when you lose all your lives.', '0', '', 0),
(259, 2, 'marketplace', 'Marketplace', 1, 69, '1', '1', 1, '0', 1, 'pets2', 'catalog_marketplace_header_en', 'catalog_note_marketplace', '', 'With the marketplace you can trade yourself to fortune!', 'How the marketplace works:', 'You put up an item for sale.\r\nOnce sold you can claim your credits.\r\n\r\nWhen you buy an item, always the cheapest one on sale is bought!\r\n\r\nCheck an items history to see what it goes for and when it is a good time to buy!', '', '0', '', 0),
